import React, { Component } from 'react';

class Rows extends Component {
    render() {
        console.log(this.props);
        return (
            <tr>
                <th>{this.props.customerName}</th>
                <th>{this.props.phone}</th>
            </tr>
        );
    }
}

export default Rows;
